    [],nt"revision_timestamp": "2016-07-27T23:05:07.679728",nt"name": "wetland-state-and-transition-model-project",nt"isopen":
    false,nt"url": null,nt"notes": "Submerged aquatic vegetation (SAV) provides
    important habitat for many species of waterfowl, including trumpeter swans (Cygnus
    buccinator), a species of greatest conservation need. The breeding population of
    trumpeter swans in Idaho is classified as u201ccritically endangeredu201d by the
    State of Idaho due to reduced breeding habitat availability, significantly declining
    nest attempts, and localized low productivity. Low productivity in trumpeter swans
    is likely related to several factors, but the availability of food resources has
    been linked to several aspects of waterfowl reproduction. Due to the importance
    of 1) hydrology as a driver of wetland condition and 2) wetland food resources to
    breeding waterfowl, researchers and managers have recommended that the relationship
    of SAV and hydrology be examined to inform effective habitat and water management
    strategies that will increase abundance of SAV species with high nutritional quality
    (e.g., sago pondweed, Stuckenia pectinata) available for breeding waterfowl. Three
    refuges (Bear Lake, Grays Lake, and Camas NWRs) in the Southeast Idaho National
    Wildlife Refuge Complex support trumpeter swans and other breeding waterfowl, and
    have developed (or are currently developing) habitat management objectives for SAV.
    However, no monitoring of SAV communities has been conducted at Grays Lake and Camas
    NWRs and very limited monitoring has been done at Bear Lake NWR. Descriptions of
    SAV communities are also lacking from the recent habitat map for Camas NWR. This
    study will quantify the species composition and abundance of SAV and local hydrology
    at select management units/areas used by nesting trumpeter swans, assess the temporal
    scale of the SAV community within the wetland cycle, and examine the reproductive
    success of trumpeter swans in relation to SAV parameters. Database development for
    trumpeter swan productivity data will enable efficient compilation of legacy and
    future survey data. Permanently established transects and water staff gauge locations
    will be used to monitor SAV and allow for repeated sampling over time to assess
    trends.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
